import React from "react";

class DetailPost extends React.Component {
  render() {
    console.log(this.props.post);
    return (
      <div className="post">
        {this.props.posts.filter(item => item.id === this.props.post)}

        <p>this is detail post</p>
      </div>
    );
  }
}

export default DetailPost;
